import React from 'react'
import './Logo.css'

export default function Logo () {
    return (
        <div className="logo-container">
            <img alt="logo" className="logo-img" src="https://vignette.wikia.nocookie.net/blizzard/images/9/98/Legacy_of_the_Void.png/revision/latest?cb=20171213154810&path-prefix=pl" />
        </div>
    )
}
